css:
.transition-03 {
  transition: 0.3s ease;
}
body {
  font-size: 12px;
  color: #a8a8a8;
  background-color: #181818;
}
atom-pane {
  border-right: 1px solid #333333;
}
atom-pane:last-child {
  border-right: none;
}
atom-pane-container atom-pane .item-views > * {
  top: 5px;
  bottom: 5px;
}
.icon::before {
  position: relative;
  top: 1px;
}
.scrollbars-visible-always /deep/ ::-webkit-scrollbar {
  width: 10px;
  height: 10px;
}
.scrollbars-visible-always /deep/ ::-webkit-scrollbar-thumb {
  border-radius: 5px;
  border: 3px solid transparent;
  background: #333333;
  background-clip: content-box;
}
.scrollbars-visible-always /deep/ ::-webkit-scrollbar-thumb:vertical:active {
  border-radius: 0;
  border-left-width: 0;
  border-right-width: 0;
}
.scrollbars-visible-always /deep/ ::-webkit-scrollbar-thumb:horizontal:active {
  border-radius: 0;
  border-top-width: 0;
  border-bottom-width: 0;
}
.btn {
  color: #b8b8b8;
  background-color: #323232;
}
.btn:focus,
.btn:hover {
  color: #f0f0f0;
  background-color: #505050;
}
.btn:active {
  color: rgba(255, 255, 255, 0.66);
  background-color: #2c2c2c;
}
.btn.selected {
  color: #ffffff;
  background-color: #505050;
}
.btn:focus,
.btn:focus:active {
  outline: none;
}
.btn .icon::before {
  position: relative;
  top: 1px;
}
.btn.btn-primary {
  color: #ffffff;
  background-color: #50e3c2;
}
.btn.btn-primary:focus,
.btn.btn-primary:hover {
  background-color: #62e6c8;
}
.btn.btn-primary:active {
  background-color: #3ee0bc;
}
.btn.btn-primary.selected {
  background-color: #62e6c8;
}
.btn.btn-primary.selected:focus,
.btn.btn-primary.selected:hover {
  background-color: #73e9ce;
}
.btn.btn-info {
  color: #ffffff;
  background-color: #5070e3;
}
.btn.btn-info:focus,
.btn.btn-info:hover {
  background-color: #627ee6;
}
.btn.btn-info:active {
  background-color: #3e62e0;
}
.btn.btn-info.selected {
  background-color: #627ee6;
}
.btn.btn-info.selected:focus,
.btn.btn-info.selected:hover {
  background-color: #738de9;
}
.btn.btn-success {
  color: #ffffff;
  background-color: #50e3c2;
}
.btn.btn-success:focus,
.btn.btn-success:hover {
  background-color: #62e6c8;
}
.btn.btn-success:active {
  background-color: #3ee0bc;
}
.btn.btn-success.selected {
  background-color: #62e6c8;
}
.btn.btn-success.selected:focus,
.btn.btn-success.selected:hover {
  background-color: #73e9ce;
}
.btn.btn-warning {
  color: #ffffff;
  background-color: #ffa40d;
}
.btn.btn-warning:focus,
.btn.btn-warning:hover {
  background-color: #ffac21;
}
.btn.btn-warning:active {
  background-color: #f89a00;
}
.btn.btn-warning.selected {
  background-color: #ffac21;
}
.btn.btn-warning.selected:focus,
.btn.btn-warning.selected:hover {
  background-color: #ffb336;
}
.btn.btn-error {
  color: #ffffff;
  background-color: #f60c31;
}
.btn.btn-error:focus,
.btn.btn-error:hover {
  background-color: #f72042;
}
.btn.btn-error:active {
  background-color: #e5082b;
}
.btn.btn-error.selected {
  background-color: #f72042;
}
.btn.btn-error.selected:focus,
.btn.btn-error.selected:hover {
  background-color: #f73352;
}
.btn-group > .btn {
  transition: 0.3s ease;
  border-color: rgba(0, 0, 0, 0.2);
}
.btn-group > .btn:hover {
  background: #181818;
}
atom-text-editor,
:host {
  background: #181818;
}
atom-text-editor::shadow .cursor {
  border-width: 2px;
  border-color: #50e3c2;
}
atom-text-editor::shadow .bracket-matcher .region {
  background: rgba(255, 255, 255, 0.1);
  border: none;
}
atom-text-editor[mini] {
  padding-left: 5px;
  color: #a8a8a8;
  background-color: #181818;
  box-shadow: 0 0 0 1px #333;
}
atom-text-editor[mini].is-focused {
  background-color: #0b0b0b;
}
atom-text-editor[mini] .placeholder-text,
atom-text-editor[mini]::shadow .placeholder-text {
  color: #808080;
}
atom-text-editor[mini] .selection .region,
atom-text-editor[mini]::shadow .selection .region {
  background-color: #252525;
}
.find-and-replace {
  border-top: 1px solid #333333;
}
.status {
  color: #a8a8a8;
}
.status-added {
  color: #50e3c2;
}
.status-ignored {
  color: #808080;
}
.status-modified {
  color: #ffd082;
}
.status-removed {
  color: #f83453;
}
.status-renamed {
  color: #5d96e4;
}
.key-binding {
  display: inline-block;
  margin-left: 1px;
  padding: 0 5px;
  line-height: 2;
  font-family: 'Helvetica Neue', Arial, sans-serif;
  font-size: .8em;
  letter-spacing: 1px;
  border-radius: 2px;
  background-color: #181818;
}
.list-group li {
  padding-left: 5px;
}
.list-group li.selected {
  color: #ffffff;
  background-color: #252525;
}
.list-group li.selected:before {
  display: none;
}
.list-tree .selected {
  color: #ffffff;
}
.list-tree.has-collapsable-children .list-nested-item > .list-tree > li,
.list-tree.has-collapsable-children .list-nested-item > .list-group > li {
  color: #a8a8a8;
}
.list-tree.has-collapsable-children .list-nested-item > .list-tree > li.status-modified,
.list-tree.has-collapsable-children .list-nested-item > .list-group > li.status-modified {
  color: #ffd082;
}
.list-tree.has-collapsable-children .list-nested-item > .list-tree > li .status-added,
.list-tree.has-collapsable-children .list-nested-item > .list-group > li .status-added {
  color: #50e3c2;
}
.select-list li {
  padding: 5px 10px;
}
.select-list .status {
  float: right;
}
.select-list.popover-list {
  padding: 5px;
  border-radius: 2px;
  background-color: #181818;
  box-shadow: 0 2px 8px 1px rgba(0, 0, 0, 0.3);
}
.select-list.popover-list .list-group {
  margin-top: 5px;
}
.select-list.popover-list .list-group li {
  padding-left: 5px;
}
.markdown-preview:not([data-use-github-style]) {
  background: #181818;
  color: #a8a8a8;
}
.panel-heading {
  border-bottom: 1px solid #333333;
  background-color: #181818;
}
.inset-panel {
  background-color: #181818;
}
.inset-panel .panel-heading {
  background-color: #222222;
}
atom-panel.modal {
  border: 1px solid #333333;
  border-top: none;
  box-shadow: 0 2px 8px 1px rgba(0, 0, 0, 0.3);
}
.inset-panel {
  border-radius: 0;
}
.loading-spinner-large {
  display: block;
  width: 64px;
  height: 64px;
  background-image: url(images/octocat-spinner-128.gif);
  background-repeat: no-repeat;
  background-size: 64px 64px;
}
.loading-spinner-large.inline-block {
  display: inline-block;
}
.loading-spinner-medium {
  display: block;
  width: 48px;
  height: 48px;
  background-image: url(images/octocat-spinner-128.gif);
  background-repeat: no-repeat;
  background-size: 48px 48px;
}
.loading-spinner-medium.inline-block {
  display: inline-block;
}
.loading-spinner-small {
  display: block;
  width: 32px;
  height: 32px;
  background-image: url(images/octocat-spinner-128.gif);
  background-repeat: no-repeat;
  background-size: 32px 32px;
}
.loading-spinner-small.inline-block {
  display: inline-block;
}
.loading-spinner-tiny {
  display: block;
  width: 16px;
  height: 16px;
  background-image: url(images/octocat-spinner-128.gif);
  background-repeat: no-repeat;
  background-size: 16px 16px;
}
.loading-spinner-tiny.inline-block {
  display: inline-block;
}
.settings-view .link {
  color: #50e3c2;
}
.settings-view .link:hover {
  color: #50e3c2;
}
.settings-view .alert {
  border: none;
}
.settings-view .config-menu {
  background: #181818;
}
.settings-view .config-menu .panels-menu li a {
  transition: 0.3s ease;
}
.settings-view .config-menu .panels-menu li.active a {
  background: #252525;
}
.settings-view .config-menu .panels-menu li:hover {
  background: #202020;
}
.settings-view .package-card {
  transition: 0.3s ease;
  background: #252525;
  border: none;
}
.settings-view .package-card:hover {
  background: #202020;
}
.ui-site-1 {
  background-color: #0088ff;
}
.ui-site-2 {
  background-color: #20b684;
}
.ui-site-3 {
  background-color: #cc8533;
}
.ui-site-4 {
  background-color: #d831b0;
}
.ui-site-5 {
  background-color: #ebdd5b;
}
.status-bar {
  font-size: 12px;
  color: #a8a8a8;
  border-top: 1px solid #333333;
  background-color: #181818;
}
.tab-bar {
  background-color: #181818;
  border-top: 1px solid #333333;
  border-bottom: 1px solid #333333;
}
.tab-bar .tab {
  color: #a8a8a8;
  height: 34px;
  line-height: 34px;
  font-size: 12px;
  border-right: 1px solid #333333;
  background-color: #181818;
  padding-right: 10px;
}
.tab-bar .tab .title {
  text-align: center;
}
.tab-bar .tab .title .icon::before {
  font-size: 13px;
}
.tab-bar .tab.active {
  flex: 1;
  color: #ffffff;
  box-shadow: 0 1px 0 #181818;
}
.tab-bar .tab.active .title {
  padding: 0;
}
.tab-bar .tab.modified .title {
  color: #50e3c2;
}
.tab-bar .tab.modified:not(:hover) .close-icon {
  top: 50%;
  right: 14px;
  margin-top: -3px;
  border-color: #5d96e4;
}
.tab-bar .tab.modified:hover .close-icon {
  color: currentColor;
}
.tab-bar .tab .close-icon {
  opacity: 0;
}
.tab-bar .tab .close-icon::before {
  text-align: center;
}
.tab-bar .tab .close-icon:hover {
  color: #ffffff;
}
.tab-bar .tab.active .close-icon:hover {
  color: #a8a8a8;
}
.tab-bar .tab.is-dragging {
  background: #000000;
  border-color: transparent;
  opacity: 0.5;
}
.tab-bar .tab.is-dragging .close-icon {
  visibility: hidden;
}
.tab-bar .tab:hover .close-icon {
  opacity: 1;
}
.text-smaller {
  font-size: smaller;
}
.text-subtle {
  color: #808080;
}
.text-highlight {
  color: #f0f0f0;
}
.text-info {
  color: #5d96e4;
}
.text-success {
  color: #50e3c2;
}
.text-warning {
  color: #ffd082;
}
.text-error {
  color: #f83453;
}
.highlight {
  padding: 1px 4px;
  color: #f0f0f0;
  border-radius: 2px;
  background-color: #202020;
}
.highlight-info {
  padding: 1px 4px;
  color: #f0f0f0;
  border-radius: 2px;
  background-color: #5070e3;
}
.highlight-warning {
  padding: 1px 4px;
  color: #f0f0f0;
  border-radius: 2px;
  background-color: #ffa40d;
}
.highlight-error {
  padding: 1px 4px;
  color: #f0f0f0;
  border-radius: 2px;
  background-color: #f60c31;
}
.highlight-success {
  padding: 1px 4px;
  color: #f0f0f0;
  border-radius: 2px;
  background-color: #50e3c2;
}
.background-message {
  font-weight: bold;
  color: #808080;
}
.tooltip .tooltip-inner {
  line-height: 1;
  padding: 0.75em;
  white-space: nowrap;
  max-width: none;
  color: #FFF;
}
.tooltip .keystroke {
  padding: 0.15em 0.4em;
  margin: 0 -0.3em 0 0.25em;
  color: #FFF;
  background: #252525;
}
.tree-view-resizer {
  border-top: 1px solid #333333;
  border-right: 1px solid #333333;
}
.tree-view {
  color: #a8a8a8;
  background-color: #181818;
}
.tree-view .list-item.selected {
  color: #ffffff;
}
.tree-view .list-item.selected::before {
  background: #252525;
}
